import React from 'react';
import { Container, ImgBackground } from './styles';
import signInImage from '../../../assets/signInImg.png';

export function SignIn() {
  return (
    <Container>
      <ImgBackground source={signInImage}>
      </ImgBackground>
    </Container>
  );
}
